script: |
  super -f text -I q12011.spq | sort > q12011.out

inputs:
  - name: q12011.spq
    data: |
      SELECT + col2 FROM tab1 (FORMAT parquet) WHERE NOT - + col1 NOT IN ( + + col2 * - col0, + col0, + col0 * - 80 * col2 * - - col2, - CAST ( + 85 AS INTEGER ) );
  - name: tab1

outputs:
  - name: q12011.out
    data: |
